ers of Purple Sage and Marshall Tucker Band entertained earlier in the day .  50 people taken to Jersey Shore Medical Center in Neptune NJ,  including a woman who went into labor after the #MarshallTuckerBand performance and was evacuated by medivac copter. Two reported deaths occured during the show that temporarily made the #Englishtown Raceway one of the largest populated instant cities in the state, with a  larger population than the municipalities of Paterson, Elizabeth or Atlantic City. A concessionaire who sold snacks to concert goers said he sold 200,000 cans of soda, and 15,000 pounds of hot dogs. While #Arista records label mate Barry Manilow topped the national music charts, #TheDead, with almost no radio support or label promotional budget played two sets of underground rock faves to a larger concert crowd that day than the current top radio hit single artist Andy Gibb ever would, and were no strangers to large crowds, having played to an estimated 600,000 four years earlier at Watkins Glen. While it would take 10 years for the new studio album they were promoting that summer #TerrapinStation to sell enough copies to go Gold, the band and their large draw were recognized as a force to be reckoned with, said longtime booking agent #RichardLoren in 2013 , after word about the New Jersey show "The industry stood up and said, '#HolyMackerel!'"";}i:108;a:1:{s:14:"comments_count";i:0;}i:109;a:1:{s:11:"likes_count";i:0;}i:110;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvJPkUoS45";}i:111;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118808322_691039811496216_2324354268859616964_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=1C1yc0shNL4AX-1Fck5&oh=3570f8f9e401dd0e8cf04d82ebbba974&oe=5F7BDC49";}i:112;a:1:{s:4:"type";s:5:"image";}i:113;a:1:{s:8:"owner_id";i:429631858;}i:114;a:1:{s:14:"owner_username";s:0:"";}i:115;a:1:{s:14:"owner_fullname";s:0:"";}i:116;a:1:{s:9:"owner_pic";s:0:"";}i:117;a:1:{s:2:"id"