-----

Dixon is the center subject of the HBO Max Docuseries On The Record, which presents her powerful haunting story as she grapples with her decision to become one of the first women of color, in the wake of #MeToo, to come forward and publicly accuse hip-hop mogul Russell Simmons of sexual assault. It also features the stories of other women accusing Simmons of sexual assault too including founding member of the first all-female DJ and rap group ‚ÄúMercedes Ladies‚Äù Sheri Sher and former model, now domestic violence awareness activist Sil Lai Abrams. The film also dives into the abuse she suffered from L.A. Reid during her time at Arista. 

We talk about the documentary, along with her impact on the music industry including her work on projects like Method Man & Mary J. Blige‚Äòs ‚ÄúI‚Äôll Be There for You/You‚Äôre All I Need to Get By‚Äù, The Show Soundtrack, Q-Tip‚Äòs Amplified LP, and Estelle‚Äôs ‚ÄéShine LP. We also talk about how the subject of racism, colorism, misogyny, and rape culture are present in our culture.

